	d_fgm b_upper[50] = {0.2000000000000000,0.2000000000000000,0.2000000000000000,0.2000000000000000,0.2000000000000000,0.2000000000000000,0.2000000000000000,0.2000000000000000,0.2000000000000000,0.2000000000000000,0.2000000000000000,0.2000000000000000,0.2000000000000000,0.2000000000000000,0.2000000000000000,0.2000000000000000,0.2000000000000000,0.2000000000000000,0.2000000000000000,0.2000000000000000,0.2000000000000000,0.2000000000000000,0.2000000000000000,0.2000000000000000,0.2000000000000000,0.2000000000000000,0.2000000000000000,0.2000000000000000,0.2000000000000000,0.2000000000000000,0.2000000000000000,0.2000000000000000,0.2000000000000000,0.2000000000000000,0.2000000000000000,0.2000000000000000,0.2000000000000000,0.2000000000000000,0.2000000000000000,0.2000000000000000,0.2000000000000000,0.2000000000000000,0.2000000000000000,0.2000000000000000,0.2000000000000000,0.2000000000000000,0.2000000000000000,0.2000000000000000,0.2000000000000000,0.2000000000000000,};
	d_fgm b_lower[50] = {-0.2000000000000000,-0.2000000000000000,-0.2000000000000000,-0.2000000000000000,-0.2000000000000000,-0.2000000000000000,-0.2000000000000000,-0.2000000000000000,-0.2000000000000000,-0.2000000000000000,-0.2000000000000000,-0.2000000000000000,-0.2000000000000000,-0.2000000000000000,-0.2000000000000000,-0.2000000000000000,-0.2000000000000000,-0.2000000000000000,-0.2000000000000000,-0.2000000000000000,-0.2000000000000000,-0.2000000000000000,-0.2000000000000000,-0.2000000000000000,-0.2000000000000000,-0.2000000000000000,-0.2000000000000000,-0.2000000000000000,-0.2000000000000000,-0.2000000000000000,-0.2000000000000000,-0.2000000000000000,-0.2000000000000000,-0.2000000000000000,-0.2000000000000000,-0.2000000000000000,-0.2000000000000000,-0.2000000000000000,-0.2000000000000000,-0.2000000000000000,-0.2000000000000000,-0.2000000000000000,-0.2000000000000000,-0.2000000000000000,-0.2000000000000000,-0.2000000000000000,-0.2000000000000000,-0.2000000000000000,-0.2000000000000000,-0.2000000000000000,};
	d_fgm beta_var = 0.9300421908558598;
	d_fgm beta_plus = 1.9300421908558598;

	d_fgm Z_new[n_opt_var],Z[n_opt_var];
	d_fgm Y_new[n_opt_var], Y[n_opt_var];
	d_fgm h[n_opt_var];
	d_fgm T[n_opt_var];

	d_fgm iter_error;

	reset_grad: for(i = 0; i < n_opt_var; i++) 
	{
		h[i] = 0;
	}
	grad: for(j = 0; j < n_states; j++)
	{
		grad_1: for(i = 0; i < n_opt_var; i++) 
		{
			h[i] += x_hat[j] * h_x[j][i];
		}
	}

	guess_initialization: for(i = 0; i < n_opt_var; i++)
	{
		Z[i] = 0;
		Y[i] = 0;
	}

	iteration_loop: for(k = 0; k < n_iter; k++)
	{
		mv_mult:for(i = 0; i < n_opt_var; i++)
		{
			T[i] = 0;
			vv_mult: for(j = 0; j < n_opt_var; j++)
			{
				T[i] += H_diff[i][j] * Y[j];
			}
			T[i] = T[i] - h[i];
		}

		projection_loop: for(i = 0; i < n_opt_var; i++)
		{
			if(T[i] > b_upper[i])
			{
				Z_new[i] = b_upper[i];
			}
			else if (T[i] < b_lower[i])
			{
				Z_new[i] = b_lower[i];
			}
			else
			{
				Z_new[i] = T[i];
			}
		}

		fgm_step:for(i = 0; i < n_opt_var; i++)
		{
			Y_new[i] = beta_plus * Z_new[i] - beta_var * Z[i];		
		}

		//iter_error = 0;
		update_loop: for(i=0; i < n_opt_var; i++)
		{
			//iter_error += fabs(Y[i] - Y_new[i]);
			Z[i] = Z_new[i];
			Y[i] = Y_new[i];
		}
		//printf("error[%d] = %f \n",k,iter_error);
	}

	output_loop: for(i=0; i < n_opt_var; i++)
	{
		u_opt[i] = Y_new[i];
	}
